 import styled from 'styled-components';

 export const StyleNameProduct = styled.div`
    font-weight: 400;
    font-size: 12px;
    line-height: 16px;
    color: rgb(56,56,61);
 `

export const WrapperReportText = styled.div`
    font-size: 11px;
    color: rgb(128,128,137);
    display: flex;
    align-items: center;
`

export const WrapperPriceText = styled.div`
    color: rgb(255,66,78);
    font-size: 16px;
    font-weight: 500;
`

export const WrapperDiscoutnText = styled.div`
    color: rgb(255,66,78);
    font-size: 16px;
    font-weight: 500;
`
